import "../Sass/_avaliacoes.scss";
import {Container, Row, Col, Form, Button} from 'react-bootstrap';
import { Link } from "react-router-dom";
import React from 'react';

const Avaliacoes = () => {
    return (
        <>
        <Container className="cont2">
        <Row className="row">
        <Col> 
        <Form>
          <h2>Avaliação</h2>
      
      <h3>A carne estava:</h3>
      {['radio'].map((type) => (
        <div key={`inline-${type}`} className="mb-3">
          <Form.Check
            inline
            label="Excelente"
            name="group1"
            type={type}
            id={`inline-${type}-1`}
          />
          <Form.Check
            inline
            label="Bom"
            name="group1"
            type={type}
            id={`inline-${type}-2`}
          />
          <Form.Check
            inline
            label="Normal"
            name="group1"
            type={type}
            id={`inline-${type}-3`}
          />
          <Form.Check
            inline
            label="Ruim"
            name="group1"
            type={type}
            id={`inline-${type}-4`}
          />
          <Form.Check
            inline
            label="Horrível"
            name="group1"
            type={type}
            id={`inline-${type}-5`}
          />
          
        </div>
      ))}
 <h3>O que achou da opção vegetariana?</h3>
      {['radio'].map((type) => (
        <div key={`inline-${type}`} className="mb-3">
          <Form.Check
            inline
            label="Excelente"
            name="group1"
            type={type}
            id={`inline-${type}-1`}
          />
          <Form.Check
            inline
            label="Bom"
            name="group1"
            type={type}
            id={`inline-${type}-2`}
          />
          <Form.Check
            inline
            label="Normal"
            name="group1"
            type={type}
            id={`inline-${type}-3`}
          />
          <Form.Check
            inline
            label="Ruim"
            name="group1"
            type={type}
            id={`inline-${type}-4`}
          />
          <Form.Check
            inline
            label="Horrível"
            name="group1"
            type={type}
            id={`inline-${type}-5`}
          />
          
        </div>
      ))}

       <h3>Qualidade do Suco</h3>
       {['radio'].map((type) => (
        <div key={`inline-${type}`} className="mb-4">
          <Form.Check
            inline
            label="Excelente"
            name="group2"
            type={type}
            id={`inline-${type}-6`}
          />
          <Form.Check
            inline
            label="Bom"
            name="group2"
            type={type}
            id={`inline-${type}-7`}
          />
          <Form.Check
            inline
            label="Normal"
            name="group2"
            type={type}
            id={`inline-${type}-8`}
          />
          <Form.Check
            inline
            label="Ruim"
            name="group2"
            type={type}
            id={`inline-${type}-9`}
          />
          <Form.Check
            inline
            label="Horrível"
            name="group2"
            type={type}
            id={`inline-${type}-10`}
          />
          
        </div>
      ))}
      <Button type="submit" id="bt-send">
        Enviar avaliação
      </Button>
    </Form>
    </Col>
      </Row>
    </Container>
    </>
    );

}

export default Avaliacoes;
